import React, { Component } from "react";
import { useParams } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';
import {Route, Routes } from 'react-router-dom';
import Navigation from './components/Navigation';
import CreateNote from './components/CreateNote';
import NotesList from './components/NotesList';
import CreateUser from './components/CreateUser';
function App() {
  return (
    <div> 
      <Navigation/>
          <Routes>
            <Route path="/" element={<div lassName="container p-4"><NotesList/></div>}/>
            <Route path='/edit/:id' element={<div lassName="container p-4"><CreateNote /></div>}/>
            <Route path='/create' element={<div lassName="container p-4"><CreateNote /></div>}/>
            <Route path='/user' element={<div lassName="container p-4"><CreateUser/></div>}/>
          </Routes>  
    </div>
  );
}

function withParams(Component) {
  return props => <Component {...props} params={useParams()} />;
}


export default App;
